import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import { Chart } from 'react-chartjs-2';

const Results = () => {
  const [dataLists, setDataLists] = useState([]);
  const chartRef = useRef(null);

  useEffect(() => {
    generateDataLists();
  }, []);

  useEffect(() => {
    if (dataLists.length > 0) {
      renderChart();
    }
  }, [dataLists]);

  const generateDataLists = async () => {
    try {
      const response = await axios.post('/f1score');
      if (response.data.success) {
        setDataLists(response.data.lists);
      }
    } catch (error) {
      console.error(error);
    }
  };

  const renderChart = () => {
    if (chartRef.current) {
      // Destroy previous Chart instance if it exists
      if (chartRef.current.chartInstance) {
        chartRef.current.chartInstance.destroy();
      }

      // Create new Chart instance
      new Chart(chartRef.current, {
        type: 'line',
        data: {
          labels: dataLists[0].map((_, index) => `Epoch ${index + 1}`),
          datasets: dataLists.map((list, index) => ({
            label: `Data List ${index + 1}`,
            data: list,
            backgroundColor: `rgba(75, 192, 192, 0.2)`,
            borderColor: `rgba(75, 192, 192, 1)`,
            borderWidth: 2,
          })),
        },
      });
    }
  };

  return (
    <div className="grid-dropdown">
      <button onClick={generateDataLists}>Generate Data Lists</button>

      <div className="chart-container">
        <canvas ref={chartRef} />
      </div>
    </div>
  );
};

export default Results;
